import React, { Component } from 'react';
import './App.css';
import Resume from './Resume';
import Phrases from './Phrases';
import 'lookinggood.png';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div class="headerstuff">
            <h1 class="center" id="title">A Resume Header</h1>
            <h2 class="center" id="author">By Sara Lichtarge</h2>
        </div>

        <div class="top">
          <h3> Your Resume Header:</h3>
        </div>
        <section id = "resumeHeader">
          <Resume />
        </section>
        <img src = "lookinggood.png" alt="good job filler"></img>
        <hr></hr>
        <section id = "phraseGenerator">
          <Phrases />
        </section>
      </div>
    );
  }
}

export default App;
